import Gallery from "react-photo-gallery";
import { renderMatches } from "react-router-dom";
import React from "react";


const settings = {
  width: '600px',
  height: ['250px', '170px'],
  layout: [1, 4],
  photos: [
    { source: '../Assets/gcet_1.jpg' },
    { source: '../Assets/gcet_2.jpg' },
    { source: '../Assets/gcet_3.jpg' },
    { source: '../Assets/gcet_4.jpg' },
    { source: '../Assets/gcet_5.jpg' },
    { source: '../Assets/gcet_6.jpg' },
  ],
  showNumOfRemainingPhotos: true
};


const BasicRows = () => <Gallery photos={settings} />;


export default BasicRows;
